    false,nt"url": null,nt"notes": "This narrative report for Rice Lake NWR
    outlines Refuge accomplishments from January through April of 1954. The report begins
    by summarizing the weather conditions and water conditions during this period. Wildlife-
    including migratory birds, upland game birds, big game animals, furbearers, predators,
    rodents, mammals, raptors, and fish- is also covered. The Refuge development and
    maintenance section discusses physical developments and plantings. Resource management
    is outlined; topics include haying, fur harvesting, and timber removal. A progress
    report on field investigations and applied research is also provided. The public
    relations section of the report describes recreational uses, Refuge visitors, hunting,
    and fishing. N-R forms are attached.",nt"license_title": "License Not Specified",nt"extras":
